var images;

images = [
  "https://th.bing.com/th/id/OIP.TuQ5Ci202ec336aEkyCOWgHaHa?w=204&h=204&c=7&r=0&o=5&dpr=1.25&pid=1.7",
  "https://th.bing.com/th/id/OIP.7bEK8zNR1hmj63EuvmzdYgHaLH?w=204&h=306&c=7&r=0&o=5&dpr=1.25&pid=1.7",
  "data:image/jpeg;base64,",
  "https://th.bing.com/th/id/OIP.k-Q-VqFQHGIw6AkQvIaVNQHaHa?w=209&h=209&c=7&r=0&o=5&dpr=1.25&pid=1.7",
  "data:image/jpeg;base64,"
];

let element_pics = document.getElementById("pics");
images.push(images[0]);
element_pics.setAttribute("src", images.shift());

document.getElementById("previous").addEventListener("click", (event) => {
  let element_pics2 = document.getElementById("pics");
  images.unshift(images.slice(-1)[0]);
  element_pics2.setAttribute("src", images.pop());
});

document.getElementById("next").addEventListener("click", (event) => {
  let element_pics3 = document.getElementById("pics");
  images.push(images[0]);
  element_pics3.setAttribute("src", images.shift());
});
